import { useState } from "react";
import Option from "../Option";

function Question (props) {

    const colorOptions = ['Black', 'Blue', 'Brown', 'Gray', 'Green', 'Pink', 'Purple', 'Red', 'Yellow', 'White'];
    const transportationOptions = ['Car', 'Airplane', 'Ship', 'Train', 'By foot'];
    const settingOptions = ['Countryside', 'Beach', 'Mountain', 'City', 'Cave'];
    const naturalPhenomenonOptions = ['Volcano', 'Earthquake', 'Tsunami', 'Hurricane', 'Storm', 'Sand storm', 'Blizzard'];
    const activityOptions = ['Pool party', 'Work out', 'Circus', 'Stay in and chill', 'Rally', 'Hiking'];
    const chillOptions = ['Gym', 'Cemetery', 'Mall', 'Pool', 'Library', 'Park', 'Sauna'];
    const taylorOptions = ['Debut', 'Fearless', 'Speak Now', 'Red', '1989', 'Reputation', 'Lover', 'Folklore', 'Evermore', 'Midnights', 'The Tortured Poets Department'];

    const options = {
        colorOptions: ['Black', 'Blue', 'Brown', 'Gray', 'Green', 'Pink', 'Purple', 'Red', 'Yellow', 'White'],
        transportationOptions: ['Car', 'Airplane', 'Ship', 'Train', 'By foot'],
        settingOptions: ['Countryside', 'Beach', 'Mountain', 'City', 'Cave'],
        naturalPhenomenonOptions: ['Volcano', 'Earthquake', 'Tsunami', 'Hurricane', 'Storm', 'Sand storm', 'Blizzard'],
        activityOptions: ['Pool party', 'Work out', 'Circus', 'Stay in and chill', 'Rally', 'Hiking'],
        chillOptions: ['Gym', 'Cemetery', 'Mall', 'Pool', 'Library', 'Park', 'Sauna'],
        taylorOptions: ['Debut', 'Fearless', 'Speak Now', 'Red', '1989', 'Reputation', 'Lover', 'Folklore', 'Evermore', 'Midnights', 'The Tortured Poets Department']
    }



    const [color, setColor] = useState('');
	const [transportation, setTransportation] = useState('');
	const [setting, setSetting] = useState('');
	const [naturalPhenomenon, setNaturalPhenomenon] = useState('');
	const [activity, setActivity] = useState('');
	const [placeToChill, setPlaceToChill] = useState('');
	const [taylorAlbum, setTaylorAlbum] = useState('');
	
	const getSelectionValue = (e) => {
		console.log(e.target.value)

		if (e.target.name === 'color') {
			setColor(e.target.value);
		} else if (e.target.name === 'transportation') {
			setTransportation(e.target.value);
		} else if (e.target.name === 'setting') {
			setSetting(e.target.value);
		} else if (e.target.name === 'naturalPhenomenon') {
			setNaturalPhenomenon(e.target.value);
		} else if (e.target.name === 'activity') {
			setActivity(e.target.value);
		} else if (e.target.name === 'placeToChill') {
			setPlaceToChill(e.target.value);
		} else if (e.target.name === 'taylorAlbum') {
			setTaylorAlbum(e.target.value);
		}
	}

	return (
        <>
            <fieldset>
                <legend>{props.label}</legend>
                {colorOptions.map(color => <Option key={`option-${color.toLowerCase()}`} id={`option-${color.toLowerCase()}`} name='color' value={color.toLowerCase()} content={color} getData={getSelectionValue}/>)}
            </fieldset>
            <fieldset>
            <legend>Choose a transportation:</legend>
                {transportationOptions.map(transportation => <Option key={`option-${transportation.toLowerCase()}`} id={`option-${transportation.toLowerCase()}`} name='transportation' value={transportation.toLowerCase()} content={transportation} getData={getSelectionValue}/>)}
            </fieldset>
            <fieldset>
                <legend>Choose a setting:</legend>
                {settingOptions.map(setting => <Option key={`option-${setting.toLowerCase()}`} id={`option-${setting.toLowerCase()}`} name='setting' value={setting.toLowerCase()} content={setting} getData={getSelectionValue}/>)}
            </fieldset>
            <fieldset>
                <legend>Choose a natural phenomenon:</legend>
                {naturalPhenomenonOptions.map(phenomenon => <Option key={`option-${phenomenon.toLowerCase().replace(/\s+/g, '-')}`} id={`option-${phenomenon.toLowerCase().replace(/\s+/g, '-')}`} name='naturalPhenomenon' value={phenomenon.toLowerCase().replace(/\s+/g, '')} content={phenomenon} getData={getSelectionValue}/>)}
            </fieldset>
            <fieldset>
                <legend>Choose something to do:</legend>
                {activityOptions.map(activity => <Option key={`option-${activity.toLowerCase().replace(/\s+/g, '-')}`} id={`option-${activity.toLowerCase().replace(/\s+/g, '-')}`} name='activity' value={activity.toLowerCase().replace(/\s+/g, '')} content={activity} getData={getSelectionValue}/>)}
            </fieldset>
            <fieldset>
                <legend>Choose a place to chill:</legend>
                {chillOptions.map(chill => <Option key={`option-${chill.toLowerCase()}`} id={`option-${chill.toLowerCase()}`} name='placeToChill' value={chill.toLowerCase()} content={chill} getData={getSelectionValue}/>)}
            </fieldset>
            <fieldset>
                <legend>Choose a Taylor Swift album:</legend>
                {taylorOptions.map(taylor => <Option key={`option-${taylor.toLowerCase().replace(/\s+/g, '-')}`} id={`option-${taylor.toLowerCase().replace(/\s+/g, '-')}`} name='taylorAlbum' value={taylor.toLowerCase().replace(/\s+/g, '')} content={taylor} getData={getSelectionValue}/>)}
            </fieldset>

        </>
	)
}

export default Question;
